let ambientLightColor = vec3.fromValues(0.5, 0.2, 0.1);
let numberOfLights = 3;
let lightColors = [vec3.fromValues(0.0, 0.0, 0.50), vec3.fromValues(0.0, 0.1, 0.05)];
let lightInitialPositions = [vec3.fromValues(0, 1, 2), vec3.fromValues(-7, 0, 2)];
